    [TestFixture]
    public class DataBridgeIntegrationTest
    {
        [TestCaseSource(typeof(TestCaseSourceOfBuffer_can_be_interpreted_if_condition_is_),
                        nameof(TestCaseSourceOfBuffer_can_be_interpreted_if_condition_is_.TestCases))]
        public void Buffer_can_be_interpreted_if_condition_is_(JVOpenOptions openOption,
                                                               JVDataSpec dataSpec,
                                                               string buffer,
                                                               Action<DataBridge> assertion)
        {
            // Arrange
            var listener = Substitute.For<IJVServiceOperationListener>();
            var readRslt = new JVReadResult();
            readRslt.SetOpenOption(openOption);
            readRslt.SetDataSpec(dataSpec);
            readRslt.SetBuffer(buffer);
            var factory = new DataBridgeFactory(listener, readRslt);

            // Act
            var result = factory.NewDataBridge();

            // Assert
            assertion(result);
        }

