                public static readonly BufferSample BT = new BufferSample("BT1202101151120002086010108020101020107            ディープインパクト                  サンデーサイレンスは生涯に１２世代の産駒を残した。その１１世代目、種牡馬生活の晩年になって送り出した最高傑作がディープインパクト。我が国で誕生した最も優れた競走馬の１頭であり、種牡馬としての能力も父に迫るものがある。現役時代は無敗で三冠を制覇したほか、ジャパンＣ、有馬記念、宝塚記念、天皇賞・春などビッグレースを総なめにした。センスの塊のような馬だったが、スタートだけは苦手とし、出遅れるのが常だった。そのため、主戦の武豊騎手は、序盤は無理せず後方に控え、勝負どころで馬群の外を通って上昇し、直線で抜け出すというレーススタイルを採った。馬群に入れることなく外をマクるのは、距離損をしても勝てるだけの能力があり、他馬に邪魔されないというメリットもあったので合理的な選択だった。ハイペリオン、リボー、ノーザンダンサー、ミルリーフなど、小柄な馬体で競馬史に名を刻んだ名馬は少なくない。ディープインパクトはその系譜に連なるサラブレッドで、引退レースの馬体重はわずか４３８キロ。近年のＪＲＡ顕彰馬のなかでこれほど小さな馬は他にいない。しかし、サイズを補う跳びの大きさがあり、それを可能にする筋肉の柔軟性、四肢の可動域の広さに恵まれ、武豊騎手はその滑らかで美しいフットワークを「飛んでいる感じ」と表現した。小兵ながら大きな馬たちを問題にしない競走成績を残したのは、フィジカル面で尋常でないものを秘めていたからであり、それを産駒に伝えることに成功したディープインパクトは、サンデーサイレンスの最高傑作に恥じない種牡馬となった。初年度産駒が４歳となった２０１２年に初のリーディングサイアーとなり、以降、その座を譲っていない。今後、あらゆる種牡馬記録を塗り替えていくだろう。父譲りの優れた瞬発力を最大の武器とし、仕上がりの早さと成長力を兼ね備え、気性は繊細で真面目。決め手が活きる直線の長いコースでとくに強い。産駒が小さめなのが欠点といえば欠点で、４００キロそこそこの馬は総じて食いが細く、非力さに悩まされている。ジェンティルドンナやキズナなど、大物産駒の多くは母方の血でサイズを補っている。キズナ、ディープブリランテ、トーセンホマレボシをはじめ、すでに多くの産駒が種牡馬となっており、馬産地の旺盛な需要に対応する形で、今後も続々と種牡馬入りすることが予想される。                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                          