                public static readonly BufferSample CS = new BufferSample("CS2201202280110001719860101スタート地点は向正面の真ん中付近｡最初の３コーナーまでは約２００ｍ｡札幌競馬場の芝コースは高低差が０.６ｍと小さく､全周にわたりほぼ平坦｡また､コース全体が丸みを帯びており､コーナーが大回りで直線部分が短いという特徴がある｡よって､３～４コーナーはかなり緩やかなカーブ｡最後の直線距離はＡコース時が２６６.１ｍ､Ｂコース時が２６７.６ｍ､Ｃコース時が２６９.１ｍ｡芝は洋芝｡芝１０００ｍは札幌コースの中では､馴染みが薄いマイナーな条件｡同競馬場の芝短距離は１２００ｍが主流なので､年によっては行われないことがある｡行われる場合は､メイクデビューや５００万クラスの平場戦が中心だ｡かなり古い記録になるが､古馬５００万クラスの水準ラップ(２Ｆ-３Ｆ)と勝ち時計(良馬場)を示すと､２３.２-３４.７=５７.９｡良馬場ならば５８秒前後の決着｡テンから飛ばしてゴールまで目一杯走ることになる｡３コーナーまでの距離は短いため､枠順はできれば内がいい｡フルゲートは１４頭で､その際の１１番ゲートより外はやや苦しい｡ただ､スタートダッシュが速い逃げ馬､二の脚が速い先行馬ならそれほど大きな不利にはならない｡逃げ～先行馬が圧倒的に有利だ｡中団以降の差し馬は苦戦必至｡２､３着はあるが勝つのは至難の業｡種牡馬成績は､かなりバラエティーに富んでいる｡どの系統でも問題ない｡　●クラス別水準ラップ(２Ｆ-３Ｆ)と勝ち時計　２歳ＯＰ特別･重賞(─)､３歳以上５００万(２３.２-３４.７=５７.９)､３歳以上１０００万(─)､３歳以上準ＯＰ･ＯＰ特別(─)､３歳以上重賞(─)                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                      