                public static IEnumerable<Tuple<FieldInfo, DataVariation>> All
                {
                    get
                    {
                        var flds = typeof(DataVariation).GetFields(BindingFlags.Public | BindingFlags.Static);
                        foreach (var fld in flds)
                        {
                            yield return Tuple.Create(fld, (DataVariation)fld.GetValue(null));
                        }
                    }
                }
                public DataVariation(JVOpenOptions openOption, JVDataSpec dataSpec, string buffer)
                {
                    OpenOption = openOption;
                    DataSpec = dataSpec;
                    Buffer = buffer;
                    Assertion = _ =>
                    {
                        Assert.That(_.GetType().Name, Does.Contain("_" + Buffer.Substring(0, 2) + "_"));
                        Assert.That(((dynamic)_).crlf, Is.EqualTo("\r\n"));
                    };
                }

                public JVOpenOptions OpenOption { get; private set; }
                public JVDataSpec DataSpec { get; private set; }
                public string Buffer { get; private set; }
                public Action<DataBridge> Assertion { get; private set; }
                public object[] Data { get => new object[] { OpenOption, DataSpec, Buffer, Assertion }; }
            }

            public static IEnumerable TestCases
            {
                get
                {
                    foreach (var (fld, dv) in DataVariation.All)
                    {
                        yield return new TestCaseData(dv.Data).SetName(fld.Name);
                    }
                }
            }
        }
